import React, { Component } from 'react';

class Profile extends Component {

  render() {
    return (
      <div>
        <h3>{this.props.userData.name}</h3>
        <div>
          <img src={this.props.userData.avatar_url} alt="profile-pic" />
          <div>{this.props.userData.public_repos}</div>
          <div>{this.props.userData.public_gists}</div>
          <div>{this.props.userData.followers}</div>
          <div>{this.props.userData.following}</div>
        </div>
      </div>
    )
  }
}

export default Profile;
